import React from 'react'
import {Container, View, Input, Icon} from '../../../atoms'


const TextIcon = ({placeholder}) => {

    return (
        <Container position="relative" >
            <Icon style={{width:'5em'}} name="search" position="absolute" left="15px" top="10px"/>
            <Input placeholder={placeholder} width="300px" padding="5px 30px 5px 45px"/>
        </Container>
    )
}

export default TextIcon
